                            <th>empty</th>
                            <th>empty</th>
                            <th>empty</th>
                        </tr> */}
                    </tbody>
                </Table>
            </Container>

        )
    }

export default connect(
    (state) => ({
        ingredients: state.ingredients.ingredientsList,
    }), {
        addIngredient: addIngredient
    }
)(ProductsList);
